import React, { useState } from 'react';
import axios from 'axios';
import './CreateUser.css';

const CreateUser = ({ token }) => {
  const [newUser, setNewUser] = useState({
    username: '',
    password: '',
    employeeCode: '',
    employeeName: '',
    department: '',
  });
  const [errors, setErrors] = useState({});

  const handleChange = (e) => {
    const { name, value } = e.target;
    setNewUser({ ...newUser, [name]: value });
    setErrors({ ...errors, [name]: '' });
  };

  const validateForm = () => {
    const newErrors = {};
    if (!newUser.username) newErrors.username = 'اسم المستخدم مطلوب';
    if (!newUser.password) newErrors.password = 'كلمة المرور مطلوبة';
    if (!newUser.employeeCode) newErrors.employeeCode = 'كود الموظف مطلوب';
    if (!newUser.employeeName) newErrors.employeeName = 'اسم الموظف مطلوب';
    if (!newUser.department) newErrors.department = 'القسم مطلوب';
    return newErrors;
  };

  const createUser = async () => {
    try {
      const validationErrors = validateForm();
      if (Object.keys(validationErrors).length > 0) {
        setErrors(validationErrors);
        return;
      }
      await axios.post('http://54.227.197.41:5000/api/users', newUser, {
        headers: { Authorization: `Bearer ${token}` },
      });
      alert('تم إنشاء المستخدم بنجاح');
      setNewUser({ username: '', password: '', employeeCode: '', employeeName: '', department: '' });
      setErrors({});
    } catch (err) {
      console.error('خطأ في إنشاء المستخدم:', err);
      alert('خطأ في إنشاء المستخدم: ' + (err.response?.data?.message || err.message));
    }
  };

  return (
    <div className="create-user">
      <h2>إنشاء مستخدم</h2>
      <form className="user-form" onSubmit={(e) => { e.preventDefault(); createUser(); }}>
        <div className="form-group">
          <label htmlFor="username">اسم المستخدم</label>
          <input
            type="text"
            id="username"
            name="username"
            value={newUser.username}
            onChange={handleChange}
            placeholder="أدخل اسم المستخدم"
            className={errors.username ? 'error' : ''}
          />
          {errors.username && <span className="error-message">{errors.username}</span>}
        </div>
        <div className="form-group">
          <label htmlFor="password">كلمة المرور</label>
          <input
            type="password"
            id="password"
            name="password"
            value={newUser.password}
            onChange={handleChange}
            placeholder="أدخل كلمة المرور"
            className={errors.password ? 'error' : ''}
          />
          {errors.password && <span className="error-message">{errors.password}</span>}
        </div>
        <div className="form-group">
          <label htmlFor="employeeCode">كود الموظف</label>
          <input
            type="text"
            id="employeeCode"
            name="employeeCode"
            value={newUser.employeeCode}
            onChange={handleChange}
            placeholder="أدخل كود الموظف"
            className={errors.employeeCode ? 'error' : ''}
          />
          {errors.employeeCode && <span className="error-message">{errors.employeeCode}</span>}
        </div>
        <div className="form-group">
          <label htmlFor="employeeName">اسم الموظف</label>
          <input
            type="text"
            id="employeeName"
            name="employeeName"
            value={newUser.employeeName}
            onChange={handleChange}
            placeholder="أدخل اسم الموظف"
            className={errors.employeeName ? 'error' : ''}
          />
          {errors.employeeName && <span className="error-message">{errors.employeeName}</span>}
        </div>
        <div className="form-group">
          <label htmlFor="department">القسم أو الوظيفة</label>
          <input
            type="text"
            id="department"
            name="department"
            value={newUser.department}
            onChange={handleChange}
            placeholder="أدخل القسم"
            className={errors.department ? 'error' : ''}
          />
          {errors.department && <span className="error-message">{errors.department}</span>}
        </div>
        <button type="submit">إنشاء مستخدم</button>
      </form>
    </div>
  );
};

export default CreateUser;
